import React from "react";




export function WhoIAm(){


    return(
        <div className="who-box">
        <h1 className="azman">AZMANAT HAQQINDA</h1>
        <p>* AZMANAT Azərbaycan Respublikasının Maliyyə Bazarlarına Nəzarət Palatası tərəfindən lisenziyalaşdırılmış və tənzimlənən qeyri-bank kredit təşkilatıdır. 2018-ci ildən fəaliyyət göstərir və tam qanuni çərçivədə xidmət təqdim edirik.</p>
        <p>* Kredit müraciətiniz avtomatik sistem tərəfindən yalnız 5 dəqiqə ərzində yoxlanılır. Təsdiq olunduqdan sonra məbləğ dərhal sizin göstərdiyiniz kart hesabına köçürülür. Uzun gözləmələr və mürəkkəb prosedurlar yoxdur.</p>
        <p>* Müxtəlif məbləğ və müddət variantları arasından sizə uyğun olanı seçin. İstənilən vaxt erkən ödəmə imkanı mövcuddur. Fərdi yanaşma və asan ödəniş qrafiki ilə kreditinizi rahat şəkildə qaytarın.</p>
        </div>
    )
}
